sys_processor.script:
(function process(g_request, g_response, g_processor) {
	var uri = g_request.getParameter('uri');
	gs.error(uri);
	if (uri == 'x_momo_jira_integr_issue.do') {
		var sysId = g_request.getParameter('sys_id');
		g_processor.redirect('/sp?id=jira_issues_form&table=x_momo_jira_integr_issue&action=2&sys_id=' + sysId);
	}

})(g_request, g_response, g_processor);
